import React from 'react';
import './IconText.css';
function IconText({text1, text2, children}) {
    return (
        <div>
            <div className="icon-text">
                {children}
                <span className="text">{text1}</span>
                <span className="highlight">{text2}</span>
            </div>
        </div>
    );
}

export default IconText;
